import React from "react";
import { Link, Route, Routes } from "react-router-dom";
import "./dashboard.css";
import report from "./ProgressReport"; // Update the import statement

const Dashboard = () => {
  return (
    <div className="main">
      <div className="title">
        <h1>Dashboard</h1>
      </div>

      <div className="other">
        <ul>
          <li>
            <Link to="/dashboard/ChatSystem">Chat System</Link>
          </li>
          <li>
            <Link to="/dashboard/achievements">Track Achievements</Link>
          </li>
          <li>
            <Link to="/dashboard/progress">View Progress Report</Link>
          </li>
        </ul>
      </div>

      <Routes>
        {/* Add a Route component for the "View Progress Report" page */}
        <Route path="/dashboard/progress" element={<report />} />
      </Routes>
    </div>
  );
};

export default Dashboard;















































